import React from "react";
import styled from "styled-components";
import HomeAccents from "./components/HomeAccents";
import Page from "../../global/Page";
const Home = () => {
    return (
        <Page>
            <HomeAccents />
            <h1>this is the home page</h1>
        </Page>
    );
};

export default Home;
